const b64 = {chars: "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/",n: 76,encode(b) {const s = this.chars;let c = "";let b1;let b2;let b3;let b4;for (let i = 0; b.length > i; i += 3) {b1 = (b[i] & 0xfc) >> 2;c += s.charAt(b1);if (b.length > i + 1) {b2 = ((b[i] & 0x03) << 4) | ((b[i + 1] & 0xf0) >> 4);c += s.charAt(b2);if (b.length > i + 2) {b3 = ((b[i + 1] & 0x0f) << 2) | ((b[i + 2] & 0xc0) >> 6);b4 = b[i + 2] & 0x3f;c += s.charAt(b3) + s.charAt(b4);} else {b3 = (b[i + 1] & 0x0f) << 2;c += `${s.charAt(b3)}=`;}} else {b2 = (b[i] & 0x03) << 4;c += `${s.charAt(b2)}==`;}}let str = "";const n = this.n;if (n >= 1) {for (let j = 0; c.length > j; j += n) {str += `${c.substring(j, j + n)}\n`;}str = str.replace(/\n+$/, "");} else {str = c;}return str;},decode(c) {const s = this.chars;const b = [];c = c.replace(/[\r\n]+/g, "");let c1;let c2;let c3;let c4;for (let i = 0; c.length > i; i += 4) {c1 = s.indexOf(c.charAt(i));c2 = s.indexOf(c.charAt(i + 1));c3 = s.indexOf(c.charAt(i + 2));c4 = s.indexOf(c.charAt(i + 3));b.push(((c1 & 0x3f) << 2) | (c2 >> 4));if (c3 >= 0) {b.push(((c2 & 0x0f) << 4) | (c3 >> 2));if (c4 >= 0) {b.push(((c3 & 0x03) << 6) | c4);}}}return b;}};
const src = "data:image/jpeg;base64,";
const canvas = document.getElementById("canvas");
const ctx = canvas.getContext("2d");
const image = new Image();
image.src = src;
let threshold = 0.8;
document.getElementById("range").addEventListener(
    "change",
    () => {
        threshold = document.getElementById("range").value;
    },
    false
);

let baseSource;
image.onload = () => {
    ctx.drawImage(image, 0, 0);
    baseSource = canvas
        .toDataURL("image/jpeg")
        .split("data:image/jpeg;base64,")[1];
    startTimer();
};

const ng = [1, 2, 3, 4, 6, 7, 8, 9, 12, 16, 17, 24, 29, 34];
const glitch = () => {
    let random;
    const indexGene = () => {
        random = [parseInt(Math.random() * 100), parseInt(Math.random() * 100)];
        for (let i = 0; i < ng.length; i++) {
            if (random[0] == ng[i]) {
                indexGene();
            }
        }
    };
    indexGene();
    const binary = b64.decode(baseSource);
    for (let i = 0; i < binary.length; i++) {
        if (binary[i] == random[0] && Math.random() > threshold) {
            binary[i] = random[1];
        }
    }
    const glitchSource = b64.encode(binary);
    document.getElementById("glitch").src = `data:image/jpeg;base64,${glitchSource}`;
};

let testTimer;

function startTimer() {
    testTimer = setInterval(() => {
        glitch();
    }, 50);
    document.getElementById("start").disabled = true;
    document.getElementById("stop").disabled = false;
}

function stopTimer() {
    clearInterval(testTimer);
    document.getElementById("stop").disabled = true;
    document.getElementById("start").disabled = false;
}